val hdfsfolders = "hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/0/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/1/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/2/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/3/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/4/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/5/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/6/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/7/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/8/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/9/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/10/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/11/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/12/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/13/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/14/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/15/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/16/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/17/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/18/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/19/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/20/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/21/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/22/*,hdfs://monarch-master/user/ubuntu/monitoring/parquet/METER_NAME_HERE/2016/3/8/23/*" 

val startTime = "2016-03-01 01:00:00"
val endTime = "2016-03-22 23:59:00"

val hdfspaths = hdfsfolders.split(",")

val ridToId = Utils.getVMRidToID(sqlContext)
val idToRid = ridToId.map(ri => (ri._2.toLong, ri._1))

// **** Section 1 Generate VM node (vmId, avgCPUUtil) ****
val vmridAvgCPU = VmCPUUtil.calculateAvgFromFile(sqlContext, hdfspaths, startTime, endTime)
// (vmId, (rid,avgCPUUtil, type))
val vmidAvgCPU = vmridAvgCPU.join(ridToId).map(r => (r._2._2, (r._1, r._2._1, "vm")))


// **** Section 3 Generate physical server ****
val rawPmnameAvgCPU = PhysicalVirtualMemoryPercentage.calculateAvgFromFile(sqlContext, hdfspaths, startTime, endTime)
val pmnameAvgCPU = rawPmnameAvgCPU.map(p => (p._1.split("_").filter(s => !s.equals("server")).mkString("_"), p._2))
val pmnameAvgCPUFormatted = pmnameAvgCPU.map(pm => (Utils.murmurHash(pm._1, 123).longValue()*10000000, pm._1, pm._2, "phyMachine"))
//debug
//    pmnameAvgCPU.collect().foreach(println)

// **** Section 4 Generate physical server to vm relation ****
val vmidToPhy = Utils.getVMIdToPhyServer(sqlContext)
val vmidToPhyEdge = vmidToPhy.map(vmpm => (vmpm._1, Utils.murmurHash(vmpm._2, 123).longValue()*10000000, 0.0, "host"))
